import {useEffect,useState} from 'react';

export default function Inventory() {
    const [itemList, setItemList] = useState();

    useEffect(() => {
          fetch('http://localhost:3001/items')
            .then(response => response.json())
            .then(data => {
             setItemList(data)
            })
            .catch(error => {
              console.error('Fetch error:', error);
            });        
        }, [])
        if (itemList) {
        return (
            <>
            <ul>
                {itemList}
            </ul>
            </>
        )
    }   
}
